import React from 'react';
import logo from './logo.svg';
import './App.css';

import Header from './components/Header';
import Navbar from './Navbar';
import Content from './components/Content';

function App() {
  return (
    <div className="App">

      <Header />
      <Navbar />
      <Content />

    </div>
  );
}

export default App;
